import React from 'react';
import { Link } from 'react-router-dom';

function DashboardPage() {
  return (
    <div>
      <h1>Dashboard</h1>
      <div>
        <Link to="/share-files">Share Files</Link>
      </div>
      <div>
        <Link to="/video-call">Video Call</Link>
      </div>
    </div>
  );
}

export default DashboardPage;
